import './App.css';
//import PastEventSection from "./PastEventSection";
//import ProjectSection from './ProjectSection';
import { BrowserRouter, Route, Switch } from "react-router-dom";
import { Provider } from "./context";
import AddPastEvent from "./AddPastEvent";
import AllPastEvents from "./AllPastEvents";
import PastEventPage from "./PastEventPage";

function App() {
  return (
    <Provider>
    <BrowserRouter>
      <Switch>
        <Route exact path="/allprojects" component={AllPastEvents} />
        <Route exact path="/project/add" component={AddPastEvent} />
        <Route exact path="/project/:id" component={PastEventPage} />
      </Switch>
    </BrowserRouter>
  </Provider>
  );
}

export default App;
